function getSinglePile(req, res, next) {
    var pupID = parseInt(req.params.id);
    db.one('select * from joblog where id = $1', pupID)
        .then(function (data) {
            res.status(200)
                .json({
                    status: 'success',
                    data: data,
                    message: 'Retrieved ONE pile'
                });
        })
        .catch(function (err) {
            return next(err);
        });
}

function getPileImage(req, res, next) {
    var pileID = parseInt(req.params.pileID);
    if (DEBUG) {
        //console.log("getPileImage");
        //console.log(req);
       // console.log("pileID:" + pileID);
        var mstr = ``;
        res.status(200).end(mstr);

    } else {

        db.one('select image from images where job_id=$1', pileID)
            .then(function (data) {
                var buf = Buffer.from(data.image);
                var result = buf.toString('base64')
                res.status(200).send(result);
            })
            .catch(function (err) {
                return next(err);
            });
    }
}

